import React from 'react';
import './Form.scss';

class Form extends React.Component {
    constructor(props) {
        super(props);
        //initial state of the component
        this.state = {
            words: 'nothing to see here',
        };
    }

    render() {
        return (
        <form>
            <input type="text" placeholder="URL" required/>
            <input type="button" name="Go" value=""/>
            <input type="radio" name="get" value="get"/>
            <label for="get">GET</label>
        </form>
        );
    }
}

export default Form;
